/** @jsxImportSource @emotion/react */
import styled from "@emotion/styled";
import Nav from "../components/Nav";
import dune from "../images/dune.jpg";
import React from "react";
import "./home.scss";

const HomeDiv = styled.div`
  background: url(${dune}) no-repeat center center fixed;
  background-size: cover;
  font-size: 24px;
  border-radius: 4px;
  color: white;
  font-weight: bold;
`;

function Home() {
  return (
    <HomeDiv>
      <Nav />
      <li>
        <button className="button button--surtur">
          <svg className="textcircle" viewBox="0 0 500 500">
            <defs>
              <path
                id="textcircle"
                d="M250,400 a150,150 0 0,1 0,-300a150,150 0 0,1 0,300Z"
              />
            </defs>
            <text>
              <textPath
                href="#textcircle"
                aria-label="Projects & client work 2020"
                textLength="900"
              >
                Projects &amp; client work 2020
              </textPath>
            </text>
          </svg>
        </button>
      </li>
      <h1>Home</h1>
      <p>Home</p>
    </HomeDiv>
  );
}

export default Home;
